import {
  Container,
  Row,
  Col,
  Alert,
  Breadcrumb,
  BreadcrumbItem,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button
} from "shards-react";

import Layout from "../components/Layout";
import SEO from "react-seo-component";

class OnlineClasses extends React.Component {
  render() {
    return (
      <Layout>
        {/* SEO Components */}
        <SEO
          title="Online Classes | Guide, Past Papers and Exercises"
          description={
            "CXC Spanish Online is the perfect free online study guide to pass your CXC Spanish exam with syllabus revision, exercises and downloadable resouces."
          }
          image={""}
          pathname={"https://www.cxcspanish.com/online-classes"}
          siteLanguage={"en"}
          siteLocale={"en"}
          twitterUsername={"_rxheem"}
        />

        <Container>
          <Breadcrumb>
            <BreadcrumbItem>
              <a href="/">Home</a>
            </BreadcrumbItem>
            <BreadcrumbItem active>Online Classes</BreadcrumbItem>
          </Breadcrumb>
        </Container>
      </Layout>
    );
  }
}

export default OnlineClasses;
